import websocket
import json


def receive(ws):
    while True:
        result = ws.recv()
        if result.count("message"):
            return json.loads(result)
        else: pass
def sendResponse(txt):
    msg = '{"type":"message","value":"'+txt+'","username":"GlassBot","idCliente":1,"clientcolor":"#ffffff"}'
    ws.send(msg)

def sendImage(img):
    msg = '{"type":"message","value":"Desculpe, só possuo este nos meus dados, mas está ai!","username":"Glassbot","idCliente":2,"clientcolor":"#3bb1a4","image":"'+img+'"}'
    ws.send(msg)
    
def tratamento(txt):
    txt.replace('?','')
    txt.replace(',','')
    return txt.lower()

    

uri = "ws://localhost:5001"
init = '{"username":"GlassBot"}'
imagem = '{"type":"message","value":"","username":"Glassbot","idCliente":2,"clientcolor":"#3bb1a4","image":"data:image/png;base64,"}'
#msg0 = '{"type":"message","value":"Olá meu nome é Glassbot! Sou atendente do Goiás Transparente e estou aqui para facilitar seu acesso.","username":"GlassBot","idCliente":2,"clientcolor":"#ffffff"}'

#msg = '{"type":"message","value":"texto","username":"GlassBot","idCliente":2,"clientcolor":"#ffffff"}'
ws = websocket.create_connection(uri)



#Parte do chat bot agr

import aiml

# Create the kernel and learn AIML files
while True:
    texto = receive(ws)
    texto = texto['value']
    if texto == 'ativar':
        ws.send(init)
        ws.send(imagem)
        break
        
kernel = aiml.Kernel()
kernel.learn("std-startup.xml")
kernel.respond("load aiml b")
sendResponse(kernel.respond("INIT 1"))
sendResponse(kernel.respond("INIT 2"))

while True:
    texto = receive(ws)
    texto = texto['value']
    if texto == "sair":
        break
    if texto == "grafico":
        sendImage("data:image/jpeg;base64,")
        continue
    tratamento(texto)
    texto = kernel.respond(texto)
    sendResponse(texto)
    

sendResponse("Até mais tarde então")
ws.close()

